import React from 'react';
import '../admin.css'; // Import the CSS file

const AdminDashboard: React.FC = () => {
    // Sample user data
    const users = [
        { id: 1, email: 'user1@example.com', phone: '123-456-7890', registered: '2023-01-15' },
        { id: 2, email: 'user2@example.com', phone: '234-567-8901', registered: '2023-02-20' },
        { id: 3, email: 'user3@example.com', phone: '345-678-9012', registered: '2023-03-25' },
        { id: 4, email: 'user4@example.com', phone: '456-789-0123', registered: '2023-04-30' },
    ];

    return (
        <div className="dashboard-container">
            <h2>Admin Dashboard</h2>
            <table className="user-table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Email</th>
                        <th>Phone</th>
                        <th>Registered Date</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map(user => (
                        <tr key={user.id}>
                            <td>{user.id}</td>
                            <td>{user.email}</td>
                            <td>{user.phone}</td>
                            <td>{user.registered}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default AdminDashboard;
